import React, { useState } from "react";
import { Progress, Upload, Button } from "antd";
import { UploadOutlined } from "@ant-design/icons";

export default function LeftColumn() {
  const [imageUrl, setImageUrl] = useState(null);

  const handleUpload = (file) => {
    const reader = new FileReader();
    reader.onload = (e) => {
      setImageUrl(e.target.result);
    };
    reader.readAsDataURL(file);
    // Prevent default upload behavior
    return false;
  };

  return (
    <div style={{ flex: 1, backgroundColor: "#f0f2f5", padding: "16px" }}>
      {/* Şəkil yükləmə yeri */}
      <div
        style={{
          height: "150px",
          width: "150px",
          backgroundColor: "#d9d9d9",
          marginBottom: "16px",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          overflow: "hidden",
          borderRadius: "8px"
        }}
      >
        {imageUrl ? (
          <img src={imageUrl} alt="Profile" style={{ width: "100%", height: "100%", objectFit: "cover" }} />
        ) : (
          <Upload beforeUpload={handleUpload} showUploadList={false}>
            <Button icon={<UploadOutlined />}>Upload</Button>
          </Upload>
        )}
      </div>

      {/* Ad və vəzifə */}
      <h2>Ehmedov Resul</h2>
      <p>Frontend Developer - React & UI/UX</p>

      {/* Linklər */}
      <ul>
        <li><a href="mailto:rasul.ahmadov.56@gmail.com">Email</a></li>
        <li><a href="https://github.com/youruser" target="_blank">GitHub</a></li>
        <li><a href="https://linkedin.com/rasul.ahmad" target="_blank">LinkedIn</a></li>
      </ul>

      {/* Skills */}
      <h3>Skills</h3>
      <div>
        <p>HTML & CSS <span>95%</span></p>
        <Progress percent={95} />
      </div>
      <div>
        <p>JavaScript <span>85%</span></p>
        <Progress percent={85} />
      </div>
      <div>
        <p>React <span>80%</span></p>
        <Progress percent={80} />
      </div>

      {/* Languages */}
      <h3>Languages</h3>
      <ul>
        <li>Azerbaijan — Professional</li>
        <li>English — Native</li>
        <li>Turkish — Conversational</li>
      </ul>

      {/* Education */}
      <h3>Education</h3>
      <p>B.Sc. In Computer Science - University Name (2020-2024)</p>
    </div>
  );
}
